object.script:
function onTick() srch = input.getBool(3) wtr = input.getBool(4)
ad = input.getNumber(1) ws = input.getNumber(2) end
function onDraw() w = screen.getWidth() h = screen.getHeight() w2 = w / 2
screen.setColor(255, 255, 255) screen.drawText(1, 1, "RESCUE")
if srch then screen.setColor(0, 255, 0) else screen.setColor(32, 32, 32) end screen.drawText(1, 8, "3:SRCH")
if wtr then screen.setColor(0, 255, 0) else screen.setColor(32, 32, 32) end screen.drawText(1, 15, "4:WTR")
--Draws Lines for Control Input visualisation screen.setColor(64, 64, 64) screen.drawLine(1, 26, 16, 26) screen.drawLine(24, 22, 24, 31)
screen.setColor(255, 255, 255) if srch or wtr then x = ad*7.5+8 y = ws*-4.5+26 else x = 8 y = 26 end screen.drawLine(x, 24, x, 28) screen.drawLine(22, y, 26, y) end
